import React from 'react'

export default function BoardFlyts() {



  return (
    <div>
        <table className='table'>
            {props.list.map((task, index) => {
                return (
                    <tr className='tr' onClick={()=>updateCurrentTask(task, index)} > 
                        <td>{task.tName}</td>
                        <td>{task.tAssigee}</td>
                        <td><button onClick={()=>deleteTask(task.tName)}>X</button></td>
                    </tr>
                )
            })}
        </table>
    </div>
  )
}
